      },
      {
        title: 'Reports',
        path: '/reports',
        name:'reports',
        icon: <IoIcons.IoIosPaper />,
        cName: 'nav-text',
        cLink: 'active-link',
      },
      {
        title: 'Products',
        path: '/products',
        name:'products',
        icon: <FaIcons.FaCartPlus />,
        cName: 'nav-text',
        cLink: 'active-link',
      },

];

export default SidebarItems;
